--
-- Table structure for table `cpus`
--

CREATE TABLE `cpus` (
  `brand` varchar(50) DEFAULT NULL,
  `line` varchar(50) DEFAULT NULL,
  `model` varchar(50) DEFAULT NULL,
  `socket` varchar(10) DEFAULT NULL,
  `p_cores` int(11) DEFAULT NULL,
  `e_cores` int(11) DEFAULT NULL,
  `threads` int(11) DEFAULT NULL,
  `base_speed` float DEFAULT NULL,
  `boost_speed` float DEFAULT NULL,
  `wattage` int(11) DEFAULT NULL,
  `pcie_gen` varchar(10) DEFAULT NULL,
  `igpu` varchar(50) DEFAULT NULL,
  `memory_type` varchar(20) DEFAULT NULL,
  `max_memory_speed` int(11) DEFAULT NULL,
  `cooler_included` varchar(10) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

